
<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>A-Frame VR Template</title>
    <style>
        body {
            margin: 0;
            font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
        }

        #vr-button {
            position: fixed;
            top: 20px;
            right: 20px;
            z-index: 1000;
            padding: 12px 24px;
            background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
            color: white;
            border: none;
            border-radius: 8px;
            font-size: 16px;
            font-weight: bold;
            cursor: pointer;
            transition: all 0.3s ease;
            box-shadow: 0 4px 15px rgba(102, 126, 234, 0.4);
        }

        #vr-button:hover {
            transform: translateY(-2px);
            box-shadow: 0 6px 20px rgba(102, 126, 234, 0.6);
        }

        #info {
            position: fixed;
            top: 20px;
            left: 20px;
            color: white;
            background: rgba(0, 0, 0, 0.7);
            padding: 10px;
            border-radius: 5px;
            font-size: 14px;
        }

        /* VR cursor styling */
        .vr-cursor {
            position: fixed;
            top: 50%;
            left: 50%;
            width: 20px;
            height: 20px;
            border: 2px solid white;
            border-radius: 50%;
            transform: translate(-50%, -50%);
            pointer-events: none;
            z-index: 9999;
        }
    </style>
    <script src="https://aframe.io/releases/1.4.0/aframe.min.js"></script>
</head>
<body>
    <div id="info">Loading A-Frame VR Template...</div>
    <button id="vr-button">Enter VR</button>

    <!-- A-Frame Scene -->
    <a-scene id="vr-scene" background="color: #87CEEB">

        <!-- Camera with cursor -->
        <a-entity camera look-controls position="0 1.6 0">
            <a-cursor
                id="cursor"
                color="#ffffff"
                animation__click="property: scale; from: 0.1 0.1 0.1; to: 1 1 1; dur: 150"
                animation__fusing="property: fusing; from: 0; to: 1; dur: 1500">
            </a-cursor>
        </a-entity>

        <!-- Lighting -->
        <a-light type="ambient" color="#ffffff" intensity="0.6"></a-light>
        <a-light type="directional" color="#ffffff" intensity="0.8" position="10 10 5"></a-light>

        <!-- Ground plane -->
        <a-plane
            position="0 0 -4"
            rotation="-90 0 0"
            width="20"
            height="20"
            color="#90EE90"
            shadow="receive: true">
        </a-plane>

        <!-- Interactive objects -->
        <a-box
            position="-2 0.5 -3"
            rotation="0 45 0"
            width="1"
            height="1"
            depth="1"
            color="#ff0000"
            shadow="cast: true"
            animation="property: rotation; to: 0 405 0; loop: true; dur: 2000"
            event-set__click="_event: mouseenter; color: #ffff00"
            event-set__mouseleave="_event: mouseleave; color: #ff0000">
        </a-box>

        <a-sphere
            position="0 1.25 -5"
            radius="1.25"
            color="#0000ff"
            shadow="cast: true"
            animation="property: position; from: 0 1.25 -5; to: 0 2.25 -5; loop: true; dir: alternate; dur: 1000"
            event-set__click="_event: mouseenter; color: #00ffff"
            event-set__mouseleave="_event: mouseleave; color: #0000ff">
        </a-sphere>

        <a-cylinder
            position="2 0.75 -3"
            radius="0.5"
            height="1.5"
            color="#00ff00"
            shadow="cast: true"
            animation="property: rotation; from: 0 0 0; to: 0 360 0; loop: true; dur: 3000"
            event-set__click="_event: mouseenter; color: #ff00ff"
            event-set__mouseleave="_event: mouseleave; color: #00ff00">
        </a-cylinder>

        <!-- Interactive text -->
        <a-text
            value="Welcome to A-Frame VR!"
            position="0 3 -3"
            align="center"
            color="#ffffff"
            width="6"
            anchor="center">
        </a-text>

        <!-- Instructions -->
        <a-text
            value="Look at objects and click to change colors"
            position="0 2.5 -3"
            align="center"
            color="#cccccc"
            width="8"
            anchor="center">
        </a-text>

    </a-scene>

    <script>
        const vrButton = document.getElementById('vr-button');
        const vrScene = document.getElementById('vr-scene');

        // VR Button functionality
        vrButton.addEventListener('click', async () => {
            if (vrScene.renderer && vrScene.renderer.xr) {
                try {
                    const session = await vrScene.renderer.xr.getSession();
                    if (session) {
                        await session.end();
                    } else {
                        await vrScene.enterVR();
                    }
                } catch (error) {
                    console.error('VR session error:', error);
                    alert('Failed to enter VR mode. Make sure you have a VR headset connected.');
                }
            } else {
                alert('VR not supported in this browser');
            }
        });

        // Handle VR session start/end
        vrScene.addEventListener('enter-vr', () => {
            vrButton.textContent = 'Exit VR';
            document.getElementById('info').textContent = 'In VR Mode - Look around and interact with objects';
        });

        vrScene.addEventListener('exit-vr', () => {
            vrButton.textContent = 'Enter VR';
            document.getElementById('info').textContent = 'VR Template Ready - Click "Enter VR" to start';
        });
